  Hospital.
  b1> MACLEAN, Jason John
  b 02.05.1973
  Address: 204 Avondale Road, Greenmeadows, Napier.
  02>' MACLEAN, Alan Haydon Awdrey m on 16.06.1962 to (2)DELL, Gladys Mary
  b 02.08.1917 d 06.07.1997
  b 24.12.1922
  Alan m, at Wanganui. Mary, d/o George Frederick Haar and Elsie Maude Hunt (of French Farm, Akaroa), b.
  at Hunterville. Address: 36 Stafford Street, Springvale, Wanganui.
  02> MACLEAN, Leonard Herbert Lionel m on 26.05.1917 to (1) WARD, Dorothy Isabel
  b 22.07.1881 d 06.01.1967
  b 29.10.1892 d 31.03.1971
  Lionel b. at Foxton and m. at Napier. Dorothy, d/o Edgar Ward and Agnes Isabel Alloway, d.
  at Auckland.
  Lionel was educated at Wanganui Collegiate School then served abroad for some years in the
  Eastern Telegraph Company before taking up farming about 1906. During WW1 he was a
  Lieutenant in the 1st NZEF (Nth Akld MR, Akld Inf Bn, NZMGC) and served in Egypt, Gallipoli,
  France and Belgium. He returned to take up the managership of Puhatikotiko Station, of
  which he became part owner, and from which he retired in 1953. He served at various time on the Cook
  Hospital Board, Poverty Bay Electric Power Board and Waikohu County Council and was a director of the New
  Zealand Co-operative Wool Marketing Association.
  01> MACLEAN, Antony Russell m on 21.08.1945 to TULLOCH, Leone Leith
  b 04.04.1918
  b 25.06.1912 d 03.07.1996
  Antony b. at Napier. Leith, d/o Lawrence Boysen Tulloch and Ivy Myrtle Gallie. Address: 1/302 Childers
  Road, Gisborne.
  Antony was educated at Te Karaka High School and worked as a farm manager at Puha, Poverty Bay. During
  WW2 he served with the NZ Division in North Africa and Italy.
  01> MACLEAN, Shona Leith m on 17.02.1973 to (1) WEBB, Ian
  b 03.02.1949
  b 14.05.1946
  Shona b. and m. at Gisborne. Ian, s/o William Webb and Ann King, b. at South Shields, England.
  Shona was educated at Auckland Diocesan School for Girls and University of Otago. Ian is an
  accountant.
  01> WEBB, Michael
  .b 04.08.1978
  Michael b. at Wellington. He is a BCom/BA student at the University of Auckland.
  01> MACLEAN, Shona Leith m on 19.10.1984 to (2) JARAY, Robert Samuel
  b 03.02.1949
  b 19.08.1945
  Shona m. at Wellington, Robert, s/o Walter Karl Jaray and Rozet Vles, b. at Nelson. Address: 2
  Mitchell Street, Brooklyn, Wellington.
  Shona has her own private practice as a sports dietitian at Wakefield Sports Medical Clinic in
  Wellington,
  Robert and Shona own a company which imports coffee machinery and green coffee which is roasted
  daily to supply the hospitality industry.
